import React, { useEffect } from "react";
import styled from "styled-components";
import { useParams } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { getPokemon } from "../redux/actions";
import { Loader } from "../components/Loader";
export const DetailPage = () => {
  const pokemonState = useSelector((state) => state.pokemon);
  const loading = useSelector((state) => state.isLoading);
  const dispatch = useDispatch();
  const { id } = useParams();

  useEffect(() => {
    dispatch(getPokemon(id));
  }, []);
  console.log(pokemonState);
  return (
    <Container>
      {loading ? (
        <Loader />
      ) : (
        <>
          <div className="header-main-pokemon">
            <span className="number-pokemon">#{pokemonState.id}</span>
            <div className="container-img-pokemon">
              <img
                src={pokemonState.image}
                alt={`Pokemon ${pokemonState?.name}`}
              />
            </div>

            <div className="container-info-pokemon">
              <h1>{pokemonState.name}</h1>
              <div className="card-types info-pokemon-type">
                {pokemonState.tipos.map((tipo) => (
                  <span
                    key={tipo.name ? tipo.name : tipo}
                    className={`${tipo.name ? tipo.name : tipo}`}
                  >
                    {tipo.name ? tipo.name : tipo}
                  </span>
                ))}
              </div>
              <div className="info-pokemon">
                <div className="group-info">
                  <p>Altura</p>
                  <span>{pokemonState.altura}</span>
                </div>
                <div className="group-info">
                  <p>Peso</p>
                  <span>{pokemonState.peso}</span>
                </div>
              </div>
            </div>
          </div>

          <div className="container-stats">
            <h1>Estad√≠sticas</h1>
            <div className="stats">
              <div className="stat-group">
                <span>Hp</span>
                <div className="progress-bar"></div>
                <span className="counter-stat">{pokemonState.vida}</span>
              </div>
              <div className="stat-group">
                <span>Attack</span>
                <div className="progress-bar"></div>
                <span className="counter-stat">{pokemonState.fuerza}</span>
              </div>
              <div className="stat-group">
                <span>Defense</span>
                <div className="progress-bar"></div>
                <span className="counter-stat">{pokemonState.defefensa}</span>
              </div>

              <div className="stat-group">
                <span>Speed</span>
                <div className="progress-bar"></div>
                <span className="counter-stat">{pokemonState.velocidad}</span>
              </div>
            </div>
          </div>
        </>
      )}
    </Container>
  );
};

const Container = styled.main`

`;
